import React from "react";
import "./Ab";
import Footer from "../Footer";

function About() {
    console.log("AboutUs component rendered");
    return (
        <>
        <div className="about-container">
            <h1 className="about-title">About Us</h1>
            <p className="about-description">
                At our company, we specialize in innovating and customizing solutions for advanced automation of electrical and control processes. Our primary focus is on developing highly efficient irrigation systems for greenhouses with crops. We use cutting-edge technology to ensure that each solution not only enhances crop productivity but also promotes sustainability and energy efficiency. Our goal is to revolutionize greenhouse agriculture, maximizing crop yield while minimizing environmental impact and operational costs.
            </p>
        </div>
        <Footer />
        </>
    );
}

export default About;
